(function() {
  $('.question-upvote').on('ajax:success', function(e, data, status, xhr) {
    $(this).html(data.count);
    if ($(this).hasClass('upvoted')) {
      return $(this).removeClass('upvoted');
    } else {
      return $(this).addClass('upvoted');
    }
  });

  $('.question-downvote').on('ajax:success', function(e, data, status, xhr) {
    $(this).html(data.count);
    if ($(this).hasClass('downvoted')) {
      return $(this).removeClass('downvoted');
    } else {
      return $(this).addClass('downvoted');
    }
  });

}).call(this);
